import React from 'react';
import { drizzleReactHooks } from '@drizzle/react-plugin';
import { Link } from 'react-router-dom';

const { useDrizzle } = drizzleReactHooks;

const DaoTraductorRow = ({ TraductorIndex, datosOptions }) => {
  const { useCacheCall } = useDrizzle();
  const { addr, datos } = useCacheCall(['Traductores'], (call) => {
    const addr = call('Traductores', 's_traductores', TraductorIndex);
    const datos = addr && call('Traductores', 'datosHolders', addr);
    return { addr, datos };
  });

  return (
    <tr key={'TRA-' + TraductorIndex}>
      <td>
        {datosOptions ? (
          <select value={datos} onChange={(e) => console.log(e.target.value)}>
            {datosOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>
        ) : (
          datos
        )}
      </td>
    </tr>
  );
};

export default DaoTraductorRow;
